import Manifest from "../manifest"
import ReactToPrint from "react-to-print";


const Printout = () => {
    return(
        <div>
            <ReactToPrint
                trigger={() => <a href="#">Print out manifest</a>}
                content={() => this.componentRef}
            />
            <Manifest ref={el => (this.componentRef = el)} />
        </div>
    )
}
export default Printout;
